import React from 'react';
import axios from 'axios';

function GetAccountByID(userID = 1) {

    axios.get('http://localhost:8080/accounts/' + userID.toString())
        .then(res=> {
            console.log(res.data)
        }).catch(err => {
            console.log(err)
        })
}

export default GetAccountByID;
